     &              (dup32*dup33*Mf(tH,gno1) - 
     &                3*CW*dup34*Mf2(tH,gno2)*UASf(All3,gno2,tH)*
     &                 ZNeu(Neu3,4)))))/
     &      (CW2*MW2*SB2*SW2*(Mf2(tH,gno1) - Mf2(tH,gno2)))

	ENDLOOP(All3)
	ENDLOOP(Neu3)

	LOOP(Cha3, 1,2,1)
	LOOP(All3, 1,6,1)

	tmp41 = B0(Mf2(tH,gno2),MASf2(All3,bH),MCha2(Cha3))

	tmp42 = B1(Mf2(tH,gno2),MCha2(Cha3),MASf2(All3,bH))

	LOOP(Ind2, 1,3,1)
	LOOP(Ind1, 1,3,1)

        dZfR1(3,gno1,gno2) = 
     &   dZfR1(3,gno1,gno2) - 
     &    1/(4.D0*Pi)*(AlfaMZ*Mf(tH,gno1)*Mf(tH,gno2)*
     &        (CB2*CKM(gno1,Ind1)*CKMC(gno2,Ind2)*
     &           UASf(All3,Ind2,bH)*VCha(Cha3,2)*
     &           (SB2*MCha(Cha3)*Re(tmp41)*
     &              (sqrt2*
     &                 (CB*MW*UASfC(All3,Ind1,bH)*UCha(Cha3,1)) - 
     &                Mf(bH,Ind1)*UASfC(All3,3 + Ind1,bH)*
     &                 UCha(Cha3,2)) + 
     &             CB*SB*Mf2(tH,gno2)*Re(tmp42)*
     &              UASfC(All3,Ind1,bH)*VChaC(Cha3,2)) + 
     &          SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &           (SB*Re(tmp42)*
     &              (CB2*UASf(All3,Ind1,bH)*
     &                 (-(sqrt2*
     &                      (MW*Mf(bH,Ind2)*
     &                       UASfC(All3,3 + Ind2,bH)*UCha(Cha3,2)))
     &                     + 2*CB*MW2*UASfC(All3,Ind2,bH)*
     &                    UCha(Cha3,1))*UChaC(Cha3,1) - 
     &                Mf(bH,Ind1)*UASf(All3,3 + Ind1,bH)*
     &                 (sqrt2*
     &                    (CB2*MW*UASfC(All3,Ind2,bH)*UCha(Cha3,1))
     &                     - CB*Mf(bH,Ind2)*
     &                    UASfC(All3,3 + Ind2,bH)*UCha(Cha3,2))*
     &                 UChaC(Cha3,2)) + 
     &             CB2*MCha(Cha3)*Re(tmp41)*UASfC(All3,Ind2,bH)*
     &              (sqrt2*
     &                 (CB*MW*UASf(All3,Ind1,bH)*UChaC(Cha3,1)) - 
     &                Mf(bH,Ind1)*UASf(All3,3 + Ind1,bH)*
     &                 UChaC(Cha3,2))*VChaC(Cha3,2))))/
     &      (CB*CB2*MW2*SB*SB2*SW2*(Mf2(tH,gno1) - Mf2(tH,gno2)))

	ENDLOOP(Ind1)
	ENDLOOP(Ind2)

	ENDLOOP(All3)
	ENDLOOP(Cha3)

	endif

#ifdef DETAILED_DEBUG
	DCOUP "dZfR1(3,gno1,gno2) =", dZfR1(3,gno1,gno2) ENDL
#endif

	ENDLOOP(gno2)

	ENDLOOP(gno1)

	end
